import { Topbar, Logo } from "./Header.styles";
import Nav from "../Nav/Nav";
import menu from "./../../database/menu.json";
// import { ReactComponent as Logo } from "./../../assets/logo.svg";

function Header() {
  console.log(menu);
  const topbarMenu = menu.topbar;

  return (
    <Topbar style={{ height: "100px", backgroundColor: "black" }}>
      <Logo/>
      <Nav menu={topbarMenu} nav={menu.navbar} />
      {/* <HeaderOptions /> */}
    </Topbar>
  );
}

export default Header;
